import React,{ Component } from 'react';
import {Link} from "react-router-dom";
import { FaLongArrowAltLeft,FaMinus,FaPlus,FaCartPlus } from 'react-icons/fa';
import { MdSettings,MdHistory,MdShoppingCart } from 'react-icons/md';
class Dashboard extends Component{
    render() {
        return(
            <div className="wrap">
                    <div className="dashboard main-content">
                        <div className="title">
                            <p className="text-center">GDS Agent App</p>
                        </div>
                        <div className="balance inn-content">
                            <ul className="list">
                                <li>
                                    <p>Balance<FaCartPlus/>  <i className="float-right">- 20000 ks</i></p>
                                </li>
                                <li>
                                    <p>Balance  <i className="float-right">- 50000 ks</i></p>
                                </li>
                                <li>
                                    <p>Balance  <i className="float-right">- 30000 ks</i></p>
                                </li>
                                <li>
                                    <p>Balance  <i className="float-right">- 10000 ks</i></p>
                                </li>
                            </ul>
                        </div>
                    </div>
                </div>
        );
    }
}
export default Dashboard;
